import { BrowserRouter, Route } from "react-router-dom";

import CelularList from "./celular.CRUD/CelularList";
import CelularDetails from "./celular.CRUD/CelularDetails";

function App() {
  return (
    <BrowserRouter>
      <Route path="/" component={CelularList} />
      <Route path="/celular/:id" component={CelularDetails} />
    </BrowserRouter>
  );
}

export default App;
